import React from "react";
import styled from "styled-components";
import Details from "./Details";

const ImageOverlap = () => {
  return (
    <Container>
      <Details />
      <Bottom>
        <p>test</p>
      </Bottom>
    </Container>
  );
};

const Container = styled.div`
  display: grid;
`;

const Bottom = styled.div`
  display: grid;
`;

export default ImageOverlap;
